   "source": [
    "# 1. Introduction \n",
    "----------------\n",
    "### Company\n",
    "****Bellabeat:**** The only health tracker for women. A high-tech company that manufactures health-focused smart products,which collect data about activity, sleep, stress, and reproductive health. Bellabet has allowed women around the globe tp empore the knowledge about their own health and habits. \n",
    "\n",
    "![Bella Leaf](https://bellabeat.com/wp-content/uploads/2021/09/leaf-on-hand.jpg)\n",
    " \n",
    "The star product for the company is Bella Leaf.\n",
    "\"Bella Leaf is a classic wellness tracker that can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress. Leaf will automatically track your night-time sleep, there is no need for you to tell the device that you are going to sleep or put it in any kind of sleep mode.\" - ***The company***.\n",
    "\n",
    "### Questions for the analysis\n",
    "\n",
    "The aim of the capstone is to analyze how non-Bellabeat consumers use their smart fitness devices. With this information, we are to provide high-level recommendations for how these insights can inform Bellabeat's marketing strategy around the following questions: \n",
    "​\n",
    "1. What are some trends in smart device usage? \n",
    "2. How could these trends apply to Bellabeat customers? \n",
    "3. How could these trends help influence Bellabeat marketing strategy\n",
    "\n",
    "### Business task\n",
    "* Analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart devices, which in this case is Fitbit. \n",
    "* Identify potential opportunities for growth and recommendations for the Bellabeat marketing strategy improvement based on trends in smart device usage.\n",
    "\n"
   ]
  },
