    "# 2. Data Preparation\n",
    "-------\n",
    "#### Data Used\n",
    "The Data originated from the Kaggle web repository, [Fitbit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit) . The data set contains personal fitness tracker from thirty fitbit users, which consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. The data includes information about daily activity, steps, and heart rate that can be used to explore users’ habits.\n",
    "![Fitbit](https://www.wareable.com/media/imager/202101/35328-original.jpg)\n",
    "\n",
    "#### Data Privacy\n",
    "The data is licensed under CC0: Public Domain, waiving all of his or her rights to the work worldwide under copyright law, including all related and neighboring rights, to the extend by law. The work can be copied, modified, distributed and perform the work, even for commercial purposes, all without asking permission.\n",
    "\n",
    "#### Data Limitation\n",
    "* **No Other Metadata Provided:** \n",
    "Information such as location, lifestyle, weather, temperature, humidity etc. would provide a deeper context to the data obtained. \n",
    "\n",
    "* **Missing Demographics:** \n",
    "Key demographics data such as gender, age, were not identified. This is a crucial missing information sine Bellabeat creates women-centric products. Insights obtained may not reflect the differences in physiology and activity patterns between different demographic groups. However, we understand such information is under a strict privacy policy.  \n",
    "\n",
    "* **Small Sample Size:** \n",
    "Thirty users is not an ideal sample size where multiple independent variables are involved. Especially when health and lifestyle data is varied across different facets of society. Insights gained may not apply to all. \n",
    "\n",
    "* **Data Collection Period:** \n",
    "31 days of data is limited in providing high-level recommendations. Seasonal trends impacts heavily on user activity and lifestyle choices. E.g. User's excercise habits differ between summer and winter. "
   ]
  },
