    "# 3. Data Exploration\n",
    "--------\n",
    "\n",
    "Looking at the numbers of unique ID, not all of the Fitbit's users used ****sleep****, ****heart rate****, and ****weight**** features. The amount of unique Ids appeared in ****weight_log**** and ****heartrate**** data are not significant enough to accurately represent its users' group. Hence, ****daily**** and ****hourly activities**** will be used to explained usage frequency for users, and will be the major part of this exploration. \n",
    "\n",
    "### Overall Usage Frequency by Day\n",
    "\n",
    "\n",
    "First, let's take a quick glimpse at the pattern on how frequent users used Fitbit in a daily level by using calender heat map. This calendar heat map illustrates the average steps taken per user by each day in the given period.\n"
   ]
