   "source": [
    "# Get number of users used their devices each day:\n",
    "obs_users <- daily %>% group_by(date) %>% \n",
    "  summarise(user_perday = sum(n()), .groups = \"drop\")\n",
    "#Plot a calendar heat map on total steps by day\n",
    "calendarPlot(obs_users, pollutant = \"user_perday\", year = 2016, month = 4:5,  cex.lim = c(0.6, 1), main = \" Usage Frequency by Day\", cols=\"increment\", key.header = \"Number of Users\", key.position = \"top\")\n",
    "options(repr.plot.width = 14, repr.plot.height = 10)"
   ]
  },
