   "source": [
    "`Oberservation`\n",
    "\n",
    "Within 31 days' data time frame, we can see one main pattern\n",
    "* All of the participate used the device ****more than half a month**** with most using their devices more frequently in the first half of the period than days towards the end with a steadily declining rate. \n",
    "\n",
    "### Usage Group Distribution\n",
    "\n",
    "Next, we will categories users (IDs) according to the frequency of Fitbit Usage, and  by breaking down this analysis further will help us understand the different trends underlying each Usage Groups. Within `daily` data set, we will assume that the days with < 200 `total_steps` taken, are days where users have not used their watches. We will filter out these inactive day and assign the following designations:\n",
    "\n",
    "\n",
    "* Low Use - ****1 to 16**** days \n",
    "* Moderate Use - ****17 to 25**** days\n",
    "* High Use - ****26 to 31**** days"
   ]
