   "source": [
    "# data transformation to create df for 'Usage Types' \n",
    "\n",
    "daily_group <- daily %>%\n",
    "  filter(total_steps >200 ) %>% \n",
    "  group_by(id) %>%\n",
    "  summarize(date=sum(n())) %>%\n",
    "  mutate(usage = case_when(\n",
    "    date >= 1 & date <= 16 ~ \"Low Use\",\n",
    "    date >= 17 & date <= 25 ~ \"Moderate Use\", \n",
    "    date >= 26 & date <= 31 ~ \"High Use\")) %>% \n",
    "  mutate(usage = factor(usage, level = c('Low Use','Moderate Use','High Use'))) %>% \n",
    "  rename(daysused = date) %>% \n",
    "  group_by(usage)\n",
    "head(daily_group)\n",
    "\n",
    "#data transformation to create df that is readable to create a pie chart\n",
    "##the 'scales' package is used here\n",
    "daily_group2 <- daily %>% \n",
    "  left_join(daily_group, by = 'id') %>%\n",
    "  group_by(usage) %>% \n",
    "  summarise(users = n_distinct(id)) %>% \n",
    "  mutate(percentage = users/sum(users)) %>% \n",
    "  arrange(percentage) %>% \n",
    "  mutate(percentage = scales::percent(percentage))\n",
    "head(daily_group2)\n",
    "\n",
    "# plot pie chart for distribution for different types of users\n",
    "\n",
    "ggplot(daily_group2,aes(fill=usage ,y = users, x=\"\")) +\n",
    "  geom_bar(stat=\"identity\", width=1, color=\"white\") +\n",
    "  coord_polar(\"y\", start=0)+\n",
    "  scale_fill_brewer(palette='Pastel2')+\n",
    "  theme_void()+\n",
    "  theme(axis.title.x= element_blank(),\n",
    "        axis.title.y = element_blank(),\n",
    "        panel.border = element_blank(), \n",
    "        panel.grid = element_blank(), \n",
    "        axis.ticks = element_blank(),\n",
    "        axis.text.x = element_blank(),\n",
    "        plot.title = element_text(hjust = 0.5,vjust= -5, size = 20, face = \"bold\")) +\n",
    "  geom_text(aes(label = percentage, x=1.2),position = position_stack(vjust = 0.5))+\n",
    "  labs(title=\"Usage Group Distribution\")+\n",
    "  guides(fill = guide_legend(title = \"Usage Type\"))\n",
    "  options(repr.plot.width = 1, repr.plot.height = 1)"
   ]
  },
