   "source": [
    "`Observation`\n",
    "\n",
    "Looking at the pie chart, we can see that \n",
    "\n",
    "- **64%** of users, 21 out of 33 participants, used their devices most frequently between 26 - 31 days.\n",
    "​\n",
    "- **24%** of users, 8 out of 33 participants, used their devices between 17 - 25 days. \n",
    "​\n",
    "- **12%** of users, 4 out of 33 participants, used their devices least frequently between 1- 16 days.\n",
    "​\n",
    "\n",
    "A large majority of users use the device frequently between 26-31 days. This reflects a reliability of this data sets. In order to accurately analyse and comprehend the data gained from Fitbit, the user has to wear it often to have a comprehensive quantitative picture of their activity habits and physiological state. \n",
    "\n",
    "> Nonetheless, it is important to note that the analysis regarding low usage group is only generated from 4 participants. Hence, the accuracy and precision might not fully reflect the true nature of the group. \n",
    "\n",
    "\n",
    "# 4. Analyze and Visualize\n",
    "--------\n",
    "\n",
    "### 4.1 Activeness Analysis\n",
    "\n",
    "The `daily` dataset designates every non-sleeping minute of the day into four different intensities - Sedentary Minutes, Lightly Active Minutes, Fairly Active Minutes and Very Active Minutes. We will explore deeper into the activeness and activity minutes of these four categories across different users' groups. \n",
    "\n"
   ]
  },
