   "source": [
    "# Summarise Active minutes by days\n",
    "daily_usage <- daily %>% \n",
    "  left_join(daily_group, by = 'id') %>% \n",
    "  mutate(total_minutes_worn = sedentary_minutes+lightly_active_minutes+\n",
    "           fairly_active_minutes+very_active_minutes) %>% \n",
    "  mutate(total_hours_worn = seconds_to_period(total_minutes_worn * 60))\n",
    "head(daily_usage,3)\n"
   ]
  },
