   "source": [
    "active1 <- daily_usage %>% \n",
    "  group_by(usage) %>%\n",
    "  summarise(very_active = round(mean(very_active_minutes),0),\n",
    "            fairly_active = round(mean(fairly_active_minutes),0),.groups = \"drop\")\n",
    "head(active1)\n",
    "\n",
    "\n",
    "active1_long <- gather(data = active1, key = \"variables\", value = \"value\", -usage)\n",
    "\n",
    "\n",
    "active1_long %>% \n",
    "  ggplot()+ geom_col(aes(x= usage, y=value, group=variables, fill=variables))+\n",
    "  theme(axis.text.x = element_text(size = 9))+\n",
    "  labs(x=\"Group of users\" , y=\"Minutes\")+\n",
    "  ggtitle(\"Comparison of Average Active Minutes\")\n",
    "options(repr.plot.width = 8, repr.plot.height = 5)\n",
    "\n",
    "\n",
    "active10 <- daily_usage %>% \n",
    "  group_by(usage) %>%\n",
    "  summarise(very_active2 = round((mean(very_active_minutes)/mean(total_minutes_worn))*100,3),\n",
    "            fairly_active2 = round((mean(fairly_active_minutes)/mean(total_minutes_worn))*100,3),\n",
    "            lightly_active2 = round((mean(lightly_active_minutes)/mean(total_minutes_worn))*100,3),\n",
    "            sedentary_active2 = round((mean(sedentary_minutes)/mean(total_minutes_worn))*100,3),\n",
    "            active = ((lightly_active2+fairly_active2+very_active2)), .groups = \"drop\")\n",
    "head(active10)"
   ]
  },
