   "source": [
    "noactive <- daily_usage %>% \n",
    "  group_by(day_week,usage) %>% \n",
    "  summarise(lightly_hr = round(mean(lightly_active_minutes)/60,0),\n",
    "            sedentary_hr = round(mean(sedentary_minutes)/60,0), .groups = \"drop\")\n",
    "\n",
    "# Reshape data \n",
    "low_light_long <- gather(data = noactive, key = \"variables\", value = \"value\", -c(usage, day_week))\n",
    "# Plot very active and fairly active minutes per day\n",
    "low_light_long %>% mutate(day_week = fct_relevel(day_week,c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))) %>% \n",
    "ggplot()+ geom_col(aes(x= day_week, y=value, group=variables, fill=usage))+\n",
    "  theme(axis.text.x = element_text(size=11, angle = 60, hjust = 1, vjust = 1))+\n",
    "  labs(x=\"Days\" , y=\"Hours\")+\n",
    "  ggtitle(\"Comparison of Low and Inactive Hours\", \"By Groups, Days and Levels\")+\n",
    "  facet_grid(variables~usage)\n",
    "options(repr.plot.width = 14, repr.plot.height = 8)\n"
   ]
  },
