   "source": [
    "`Observation`\n",
    "\n",
    "* From the charts, lighly active time between moderate use and high use are similar to each others. High usage group is inactive evenly throughout the week but moderate usage group is more inactive during the beginning of the weekdays (Mon-Wed) and for low usage is on Sat-Mon. \n",
    "\n",
    "| Group | Active % | Sedentary % |\n",
    "| --- | --- | --- |\n",
    "| Low Use | 4.9% | 95.1% |\n",
    "| Moderate Use | 17.5% | 82.5% |\n",
    "| High Use | 21.3% | 78.7% |\n",
    "\n",
    "* In conclusion, the activeness increases as the users use Fitbit more often. The gap between low and moderate group also differ by a huge amount of 12.6%!\n",
    "\n",
    "## Steps\n",
