   "source": [
    "#data for steps \n",
    "steps_hour <- daily_usage %>% \n",
    "  group_by(day_week) %>%   \n",
    "  summarise(mean_steps = round(mean(total_steps))) %>%\n",
    " mutate(day_week = factor(day_week, level = c('Monday', 'Tuesday', 'Wednesday','Thursday', 'Friday', 'Saturday', 'Sunday')))\n",
    "\n",
    "#plot for avg steps by day \n",
    "ggplot(steps_hour, aes(x = day_week, y= mean_steps, fill = mean_steps)) +\n",
    "    geom_col(color=\"darkblue\", size = 0.1) +  \n",
    " scale_fill_gradientn(limits=c(0,10000), breaks=seq(0,10000, by = 2000), colours = brewer.pal(5, \"Purples\")) + \n",
    "  scale_y_continuous(limits=c(0,10000), breaks=seq(0, 10000, by = 2000))+ \n",
    "labs(title= (\"Average Steps\"), subtitle = ('By Day'), x=\"\" , y=\"Mean Step\")+\n",
    "theme(plot.title=element_text(size = 16,hjust = 0))+\n",
    "    theme(plot.subtitle=element_text(size = 14,hjust = 0))+\n",
    "    theme(axis.text.y=element_text(size=14)) +\n",
    "    theme(axis.text.x=element_text(size=14,hjust= 0.5))+\n",
    "    theme(axis.title.x = element_text(margin = margin(t = 14, r = 0, b = 0, l = 0)))+\n",
    "    theme(axis.title.y = element_text(margin = margin(t = 0, r = 10, b = 0, l = 0)))+\n",
    "    theme(legend.position = \"top\")+\n",
    "    theme(legend.title=element_text(size=12))+\n",
    "    theme(legend.text=element_text(size=8))+\n",
    "guides(fill = guide_colourbar(barwidth = 12))\n",
    "options(repr.plot.width = 10, repr.plot.height = 8)"
   ]
  },
