   "source": [
    "`Observation`\n",
    "\n",
    "* It can be clearly seen that users take more steps at the beginning of weekend (Sat) and weekdays (Mon-Tue). \n",
    "\n",
    "### Average Steps per Hour per Group\n",
    "\n",
    "Moving on, we will breakdown the analysis of average steps further by hourly duration and by groups. Here we are able to observe to some extent the differences in hourly activity and walking habits of each group in given period of time. \n",
    "\n",
    "**However, it is important to note that the 'Low Use' group has only 4 participants, therefore insights gained are limited as it does not follow a normalised distribution within this sub-group.**"
   ]
