   "source": [
    "`Observation`\n",
    "\n",
    "At a closer inspection, the step hourly for each groups peaks at different time interval as followed:\n",
    "\n",
    "* Low Use: There is no clear pattern for low use group.\n",
    "\n",
    "* Moderate Use: Peak hour is around the morning time between `8:00 to 11:00` with Saturday and Sunday having higher average steps. \n",
    "\n",
    "* High Use: Peak hour is around the morning time between `16:00 to 19:00` with Wednesday having higher average steps. On the other hand, Saturday shows different pattern and have highest peak around `12:00 - 13:00`.\n",
    "\n",
    "### Intensities per Hour\n",
    "Steps and Intensities are often mentioned together. Number of steps are not always equivalent to the intensities of steps. Thus, we will analyse the intensities by groups in given period of time. "
   ]
