   "source": [
    "`Observation` \n",
    "\n",
    "The correlograms show strong positive relations between ****steps walked**** and ****intensity**** among all three groups. \n",
    "\n",
    "- Number of *steps walked* increases as users increase their *levels of intensity* particularly for **low** and **moderate** usage groups.\n",
    "- The more *vigorously* one performs the further *distance* levels made, this is more significant for **low** and **moderate** groups of users.\n",
    "- In general, **high** usage group has a slightly less significant correlation compare to the other two in both terms.\n",
    "- High usage group sees a decrease in steps taken as intensity exceeds ****30****\n",
    "\n",
    "### Calories & Steps"
   ]
