   "source": [
    "## Scatter plot correlation between Sedentary minutes and Sleep \n",
    "steps_sleep <- merge(sleep, daily_usage, by=c('id', 'date'))\n",
    "\n",
    "ggplot(steps_sleep, aes(x= asleep_mins, y = sedentary_minutes))+ \n",
    "         geom_point(size = 1)+ geom_smooth(method = 'loess', formula= y ~ x)+\n",
    "  labs(x=\"Sleep by minutes\" , y=\"Sedentary minutes\")+\n",
    "  ggtitle(\"Correlation of Sleep and Sedentary Minutes\",)+\n",
    "  theme(legend.position = \"bottom\")+\n",
    "  scale_x_continuous(labels = )\n",
    "options(repr.plot.width = 14, repr.plot.height = 8)\n"
   ]
  },
