   "source": [
    "`Obeservation`\n",
    "\n",
    "The correlograms show negative relationship between ****sleep minutes**** and ****sedentary minutes****. \n",
    "\n",
    "In general, the more time one spends asleep, the less time one spends inactive throughout the day.\n",
    "* The change is sharper up to 300 minutes (5 hours). \n",
    "* Users that sleep for more than 600 minutes (10 hours) do not see a fall in inactive hours.\n",
    "* People who sleep for more than 700 minutes (more than 11 hours) see an increase in inactivity for the rest of the day. \n",
    "\n",
    "Users should be made aware of and advised on the right sleeping amount.\n",
    "\n",
    "## 4.3 Sleep Analysis\n",
    "\n",
    "Now, we will take a step deeper than the above plot by splitting the average sleeping hours across the different users' groups.\n",
    "\n",
    "\n",
    "### Sleep Distribution \n",
    "\n",
    "Here, we plot out the distribution of sleep for all participants based on the number of hours of sleep recommended by the National Sleep Foundation:\n",
    "\n",
    "* Below Recommended -  < 6 hours of sleep\n",
    "* Fairly Recommended -  6 and 7 hours of sleep\n",
    "* Recommended -  7 and 9 hours of sleep\n",
    "* Above Recommended - > 9 hours of sleep\n",
    "\n"
   ]
  },
