   "source": [
    "#data for sleep analysis\n",
    "daily_sleepminutes <- sleep %>% \n",
    "  mutate(Day = format(ymd(date), format = '%a')) %>% \n",
    "  select(\"Day\",\"asleep_mins\",\"bed_mins\") %>% \n",
    "  mutate(Day = factor(Day,level = c('Mon', 'Tue',\n",
    "                                    'Wed','Thu', 'Fri', 'Sat', 'Sun')))%>% \n",
    "  group_by(Day) %>% \n",
    "  summarise(minutesasleep = round(mean(asleep_mins)/60,2),\n",
    "            timeinbed = round(mean(bed_mins)/60,2)) %>% \n",
    "  mutate(hoursasleep = round(seconds_to_period(minutesasleep*60*60),-2))\n",
    "head(daily_sleepminutes,3)\n",
    "\n",
    "#data manipulation for avg_hours_sleep\n",
    "sleep_avg_hours <- sleep %>%\n",
    "  mutate(day = format(ymd(date), format = '%a')) %>% \n",
    "  mutate(timeawakeinbed = bed_mins - asleep_mins) %>% \n",
    " group_by(day) %>% \n",
    "  summarize(avg_hrs_asleep = round((mean(asleep_mins/60)),2), \n",
    "            avg_hrs_in_bed = round((mean(bed_mins/60)),2),\n",
    "            avg_hrs_awake = round((mean(timeawakeinbed/60)),2),\n",
    "            std_hrs_in_bed = round((sd(asleep_mins/60)),2),\n",
    "            std_hrs_asleep = round((sd(bed_mins/60)),2),\n",
    "            std_hrs_awake = round((sd(timeawakeinbed/60)),2)) %>%\n",
    "mutate(day = factor(day, level = c('Mon', 'Tue', 'Wed','Thu', 'Fri', 'Sat', 'Sun')))\n",
    "\n",
    "head(sleep_avg_hours)\n",
    "\n",
    "ggplot(sleep_avg_hours, aes(x = day, y= avg_hrs_asleep, fill = avg_hrs_asleep)) +\n",
    "    geom_col(color=\"pink\", size = 0.1) +\n",
    "    geom_errorbar(mapping=aes(ymin = avg_hrs_asleep - 0.5 * (std_hrs_asleep), \n",
    "                            ymax = avg_hrs_asleep + 0.5 * (std_hrs_asleep), width = 0.5)) +\n",
    "    geom_text(aes(label = avg_hrs_asleep, y =0.4), position = position_dodge(0.9), \n",
    "              size = 5, angle = 0,  color = \"black\", hjust = 0.5)+\n",
    "    scale_fill_gradientn(limits=c(0,9), breaks=seq(0,9, by = 2), colours = brewer.pal(5, \"Blues\")) + \n",
    "    scale_y_continuous(limits=c(0,9), breaks=seq(0,9, by = 1))+\n",
    "    labs(title= (\"Average Hours Asleep\"), subtitle = ('By Days'), y='Hours')+\n",
    "    theme(plot.title=element_text(size = 16,hjust = 0))+\n",
    "    theme(plot.subtitle=element_text(size = 14,hjust = 0))+\n",
    "    theme(axis.text.y = element_text(size=16, hjust =  )) +\n",
    "    theme(axis.text.x = element_text(size=16,hjust= 0.5, vjust = -2))+\n",
    "    theme(axis.title.x = element_blank())+\n",
    "    theme(axis.title.y = element_blank())+\n",
    "    theme(legend.position = \"right\")+\n",
    "    theme(legend.title=element_text(size=12))+\n",
    "    theme(legend.text=element_text(size=8))\n",
    "options(repr.plot.width = 20, repr.plot.height = 12)"
   ]
  },
