    "\n",
    "- The average hour of sleep is relatively higher on the weekends.\n",
    "- Thursdays has lowest average hour of sleep, while Sunday has highest average hour or sleep.\n",
    "- It is of note that Wednesday has the highest average sleep during the weekdays with low deviation.\n",
    "\n",
    "### Average Hour of Sleep Among Groups"
