    "#data prep\n",
    "sleep_avg_hours_group <- sleep %>% \n",
    "  left_join(daily_group, by = 'id') %>%\n",
    "  mutate(day = format(ymd(date), format = '%a')) %>% \n",
    "  group_by(day, usage) %>% \n",
    "  summarise(avg_hrs_asleep = round(mean(asleep_mins)/60,2),\n",
    "            avg_hrs_in_bed = round(mean(bed_mins)/60,2),\n",
    "            std_hrs_asleep = round((sd(asleep_mins/60)),2),\n",
    "            std_hrs_in_bed = round((sd(bed_mins/60)),2)) %>% \n",
    "  mutate(day = factor(day, level = c('Mon', 'Tue', 'Wed','Thu', 'Fri', 'Sat', 'Sun')))\n",
    "head(sleep_avg_hours_group)\n",
    "\n",
    "ggplot(sleep_avg_hours_group, aes(x = day, y= avg_hrs_asleep, fill = avg_hrs_asleep)) +\n",
    "    geom_col(color=\"darkblue\", size = 0.2) +\n",
    "    geom_errorbar(mapping=aes(ymin = avg_hrs_asleep - 0.5 * (std_hrs_asleep), \n",
    "                            ymax = avg_hrs_asleep + 0.5 * (std_hrs_asleep), \n",
    "                            width = 0.5)) +\n",
    "    geom_text(aes(label = avg_hrs_asleep, y =0.4), position = position_dodge(0.9), size = 4.5, angle = 0,  color = \"black\", hjust = 0.5)+\n",
    "    scale_fill_gradientn(limits=c(0,9), breaks=seq(0,9, by = 2), colours = brewer.pal(5, \"Greens\")) + \n",
    "    scale_y_continuous(limits=c(0,9), breaks=seq(0,9, by = 1))+\n",
    "    labs(title= (\"Average Hours Asleep\"), subtitle = ('By Group, Days'), x='Day', y='Hours')+\n",
    "    theme(plot.title=element_text(size = 16,hjust = 0))+\n",
    "    theme(plot.subtitle=element_text(size = 14,hjust = 0))+\n",
    "    theme(axis.text.y=element_text(size=9)) +\n",
    "    theme(axis.text.x=element_text(size=14,hjust= 0.5))+\n",
    "    theme(axis.title.x = element_text(margin = margin(t = 14, r = 0, b = 0, l = 0)))+\n",
    "    theme(axis.title.y = element_text(margin = margin(t = 0, r = 10, b = 0, l = 0)))+\n",
    "    theme(legend.position = \"top\")+\n",
    "    theme(legend.title=element_text(size=12))+\n",
    "    theme(legend.text=element_text(size=8)) +\n",
    "    facet_grid(~usage)\n",
    "options(repr.plot.width = 14, repr.plot.height = 10)\n",
    "\n",
    "\n",
    "sleep_group_3 <- sleep %>%  left_join(daily_group, by = 'id') %>%\n",
    "  mutate(day = format(ymd(date), format = '%a')) %>% \n",
    "  group_by(usage) %>%\n",
    "  summarise(asleep_mins = round(mean(asleep_mins)/60,2),\n",
    "            bed_mins = round(mean(bed_mins)/60,2),.groups = \"drop\")\n",
    "head(sleep_group_3)\n",
    "\n"
   ]
  },
