   "source": [
    "`Observation`\n",
    "\n",
    "- The 'High Use' group has a relatively lower average hours of sleep than moderate usage. The variability of sleep for this group also follows a more consistent pattern as oppose to other groups.  \n",
    "- The 'Moderate Use' group has the highest average hours of sleep amongst all the groups. The variability of sleep is inconsistent through the week, pointing to various sleep patterns amongst its users. \n",
    "-  The 'Low Use' group only has a sample size of 4 and will not be considered for this analysis. \n",
    "\n"
   ]
