   "source": [
    "\n",
    "# Discussion\n",
    "----------\n",
    "\n",
    "The FitBit data sets confirm that not all users fully utilize the functions of their devices/trackers. All 33 unique IDs used the step count function. 24/33 unique IDs used the sleep tracking function. 14/33 unique IDs used the heart-rate tracking. 8/33 unique IDs used their devices to track their weight. With the exception of the step count function, all other functions were used irregularly throughout the data tracking period. \n",
    "\n",
    "\n",
    "Trends in different usage groups\n",
    "\n",
    "\n",
    "****High Usage****: \n",
    "\n",
    "* This group consists of 21 users or 64% of the total sample size, and wears the device regularly between 26-31 days. \n",
    "* The most active group with 21.3% activeness of the time. They are even more active especially between Sat-Tue, with a few outliers observed. They are generally inactive more during weekdays. They have similar lightly_active with Moderate Use Group. \n",
    "* On average, peak hour is around the morning time between `16:00 to 19:00` with Wednesday having higher average steps. On the other hand, Saturday shows different pattern and have highest peak around `12:00 - 13:00`.\n",
    "* Amongst all other groups, they have the highest and also the widest range in calorie burned, steps taken, and intensities. Suggesting users are varied in the ways that they are active. \n",
    "* They are consistently active throughout the week with little significant difference in activity minutes between weekdays and weekends, signifying a habitual exercise routine.\n",
    "* High Usage group see highest correlation between `Steps` and `Calories Burned`! However, both `Calories Burned` and `Intensity` decreases after reaching 30,000 steps, which shows extremem tiredness. \n",
    "* The 'High Use' group has a relatively lower average hours of sleep than moderate usage. The variability of sleep for this group also follows a more consistent pattern as oppose to other groups.  \n",
    "\n",
    "\n",
    "\n",
    "****Moderate Usage****:\n",
    "* This group consists of 8 users or 24% of the total sample size, and wears the device regularly between 17-25 days. \n",
    "* The middle active group with 17.5% activeness of the time with no particular peak pattern for activeness. They are generally inactive more during weekends and Monday. \n",
    "* On average, peak hour for steps is around the morning time between `8:00 to 11:00` with Saturday and Sunday having higher average steps. \n",
    "* Moderate Use group intensity dramatically increases as the steps taken increase.\n",
    "* The 'Moderate Use' group has the highest average hours of sleep amongst all the groups. The variability of sleep is inconsistent through the week, pointing to various sleep patterns amongst its users. \n",
    "\n",
    "\n",
    "\n",
    "****Low Usage****: \n",
    "* This group consists of 4 users or 12% of the total sample size, and wears the device regularly between 1-16 days. \n",
    "* The least active group with 4.9% activeness of the time with no particular peak pattern for activeness. They are generally inactive more during weekends and Monday. \n",
    "* There is no clear pattern of steps, calories, and intensity for low use group.\n",
    "* They sleep at fairly recommended level despite high level of sedantary minutes.\n",
    "\n",
    "****Limitations****\n",
    "* Low Usage group contained only 4 participants, which means that the result from analysis might not accurately represent the groups' actual habits. \n",
    "* The data does not included other vairables such as gender, ethnicity, and weather. The exclusion of gender is especially serious considering the nature of the Bellabeat's brand, which specifically targeted women.\n",
    "\n",
    "***\n",
    "\n"
   ]
