   "source": [
    "## Recommendations\n",
    "\n",
    "Bellabeat's target: \n",
    "\n",
    "After analysis and considering Bellabeat's target, Bellabeat can follow these recommendations:\n",
    "\n",
    "1) Since Bellabeat product is in the form of jewellry, the users could not keep track of their data real time without a smart phone. Bellabeat should consider installing a LED indicator on the jewellry. The LED can be used as an indicator on many occasions such as flicking upon reaching minimum steps per day that the users had set as their goals. \n",
    "\n",
    "2) The correlograms show negative relationship between ****sleep minutes**** and ****sedentary minutes****. Bellabeat can encourages women to sleep between 6-9 hours for maximum activeness possible within a day. \n",
    "\n",
    "3) Bellabeat can use the least peak hour for each groups to send the reminders for exercises to them. \n",
